import React from 'react'
import blank from '../img/symbols/WHITESPACE.png'
import './CardDisplay.css'

export default function CardDisplay({activeCard, handleClick}) {
    return (
      <div className="Card">
          <img key={Date.now()}
              src={activeCard}
              className="card-img"
              alt={blank}
              onClick={handleClick}
          />
      </div>
    ); 
}
